import { useNavigate } from "react-router-dom";
import { OrderHistoryImg } from "../../locales/images/orderHistory";
import { MenuButton } from "../../styles/Menu";
import { SerifText, SerifTextS } from "../../styles/TextStyles";
import { chooseIcon } from "../functions/getIcon";

export const MenuButtonY = ({ label, img }: any) => {
  const navigate = useNavigate();
  return (
    <MenuButton onClick={() => navigate("/")}>
      <div
        style={{
          flex: 1,
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        {chooseIcon(img, "")}
      </div>
      <div
        style={{
          flex: 6,
          display: "flex",
          alignItems: "center",
          marginLeft: "10px",
        }}
      >
        <SerifText>{label}</SerifText>
      </div>
    </MenuButton>
  );
};
